INSERT INTO `academies` (`id`, `short_desc`, `desc`) VALUES
(1, 'اکادمی بازیافت ایک اشاعتی ادارہ ہے۔ اردو دنیا کی معروف و ممتاز شخصیات کی کتابیں اس ادارے سے شائع ہوچکی ہیں۔ اپنے ادبی، فکری اور اشاعتی معیار کے حوالے سے اکادمی بازیافت کی کتابیں صرف پاکستان میں ہی نہیں، بلکہ بیرونِ ملک بھی الگ سے پہچانی اور قدر کی نگاہ سے دیکھی جاتی ہیں۔', 'اکادمی بازیافت ایک اشاعتی ادارہ ہے۔ 1996ء میں قائم ہونے والا یہ ادارہ ابتدا میں صرف ادبی جریدے ’’مکالمہ‘‘ کی اشاعت تک محدود تھا، لیکن 2001ء سے کتابوں کی اشاعت کے سلسلے کا باقاعدہ آغاز ہوا۔ افسانے، شاعری، ناول، خاکے، یادیں، تراجم، تنقید، مذہب اور تہذیب کے موضوعات پر اب تک اردو دنیا کی معروف و ممتاز شخصیات کی کتابیں اکادمی بازیافت سے شائع ہوچکی ہیں۔ ان میں سلیم احمد، عزیز حامد مدنی، ادا جعفری، جمیل الدین عالی، اسد محمد خاں، شمس الرحمن فاروقی، ساقی فاروقی، مشفق خواجہ، حسینہ معین، رضیہ فصیح احمد، جمال پانی پتی، سحر انصاری، سیّد مظہر جمیل، باقر نقوی، اقبال حیدر، نسیم سیّد، عبداللہ جاوید، نجم الحسن رضوی، شفیع عقیل، زبیر رضوی، رضی مجتبیٰ اور صبیح رحمانی جیسے نام ور لوگ شامل ہیں۔ اکادمی بازیافت کی کتابیں اپنے ادبی، فکری اور اشاعتی معیار کے حوالے سے صرف پاکستان میں ہی نہیں، بلکہ بیرونِ ملک بھی الگ سے پہچانی اور قدر کی نگاہ سے دیکھی جاتی ہیں۔ کسی کتاب کا اس ادارے سے شائع ہونا معیار کی ضمانت سمجھا جاتا ہے۔');
