(8, 'اوراقِ بوسیدہ', NULL, '1968-03-03', 4, , 'Maosaum Maosum.jpg', 4, '۔۔۔۔۔ نے خواب دیکھا، بچہ ہونے والا ہے، لیکن ہوگا داہنی چھاتی سے۔ دونوں بوڑھی عورتیں باہر برآمدے میں بیٹھی کپڑے سی رہی ہیں۔ وہ کہتی ہیں، لڑکا ہوگا۔ خواب دیکھنے والی کہتی ہے، لڑکی، کیوںکہ پچھلی دفعہ درد اس طرف ہوا تھا تو لڑکا ہوا، اس بار درد اِس طرف ہے، اس لیے لڑکی۔ آہستہ آہستہ چھید بننا شروع ہوتا ہے جو بڑھتا جاتا ہے۔ پھر اس میں سے سر جھانکتا ہے اور دباؤ ڈالنے سے بچہ پیدا ہوجاتا ہے جو لڑکی ہے موٹی تندرست اور گوری۔ وہ روتی نہیں ہے۔ یہ کہتی ہیں، کچھ کرو۔ کوئی کچھ نہیں کرتا۔ نال بہت چھوٹی اور چھوٹی انگلی سے بھی پتلی ہے جس پر کلیمپ (clamp) لگا دیا جاتا ہے۔ دونوں بحث کرنے لگتے ہیں۔ پھر بچی کی پیٹھ پر دھپ لگاتے ہیں اور وہ رونے لگتی ہے۔'),
(9, 'بلاگ کا نام', NULL, '2019-05-07', 2, , 'download.jpg', 2, 'بلاگ کے بارے مے لکھیں بلاگ کے بارے مے لکھیں بلاگ کے بارے مے لکھیں بلاگ کے بارے مے لکھیں بلاگ کے بارے مے لکھیں');
