INSERT INTO `mukalamas` (`id`, `short_desc`, `desc`) VALUES
(1, 'مکالمہ ادبی رسالہ ہے، جس میں ادب کے علاوہ تہذیب، ثقافت اور فنونِ لطیفہ کے دوسرے شعبوں کا بھی احاطہ کیا جاتا ہے۔ اس رسالے کو آغاز ہی سے اردو دنیا کی ممتاز اور نام ور تخلیقی و تنقیدی شخصیات کا خصوصی تعاون حاصل رہا ہے۔ یہی وجہ ہے کہ اہلِ نظر مکالمہ کے ہر شمارے کو ایک دستاویز کی حیثیت دیتے ہیں۔ مکالمہ اردو کے ان رسائل و جرائد میں نمایاں مقام رکھتا ہے جنھوں نے مسلسل اپنے معیار کو قائم رکھا ہے۔', 'مکالمہ ادبی رسالہ ہے۔ اس میں ادب کے ساتھ ساتھ تہذیب، ثقافت اور فنونِ لطیفہ کے دوسرے شعبوں کا بھی احاطہ کیا جاتا ہے۔ تہذیبی اور نظریاتی بنیاد کے حامل اس جریدے میں فکر و خیال اور اظہار کی آزادی کو ہر انسان کا حق گردانتے ہوئے زبان و ادب اور فکر و نظر کے ہر مکتبِ فکر کو خوش آمدید کہا جاتا ہے۔ اس رسالے کو آغاز ہی سے اردو دنیا کی ممتاز اور نام ور شخصیات کا خصوصی تعاون حاصل رہا ہے۔ یہی وجہ ہے کہ اہلِ نظر مکالمہ کے ہر شمارے کو شعری، افسانوی، تنقیدی اور تحقیقی ادب کے حوالے سے ایک دستاویز کی حیثیت دیتے ہیں۔ اس میں اردو دنیا کی نمائندہ شخصیات کے ساتھ جواں سال ادیبوں شاعروں کی نگارشات بھی شائع ہوتی ہیں۔ مکالمہ اردو کے ان رسائل و جرائد میں نمایاں مقام رکھتا ہے جنھوں نے بہت جلد اپنی پہچان بنائی اور مسلسل اپنے معیار کو قائم رکھا ہے۔ مکالمہ کا پہلا شمارہ اکتوبر 1996ء میں شائع ہوا تھا۔ 2016ء تک یہ رسالہ طویل وقفوں کے ساتھ شائع ہوتا رہا۔ اس کے بعد سے اس کی اشاعت ماہنامے کے طور پر ہورہی ہے۔ ’’مکالمہ‘‘ کے خصوصی شماروں میں دو جلدوں میں ہم عصر اردو افسانہ نمبر اور سال نامہ شامل ہیں۔');
